import React, { useState } from 'react';

function AddPlant() {
  const [formData, setFormData] = useState({
    name: '',
    scientific_name: '',
    adopted_tech: '',
    avg_yield: '',
    edible_part: '',
    family: '',
    nutrition: '',
    pests: '',
    planting_material: '',
    pollination: '',
    source: '',
    variety: '',
    vernacular_name: '',
    flowering: '',
    fruiting: '',
    duration: ''
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData({
      ...formData,
      [name]: value
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    fetch('http://localhost:8081/addplant', {
      method: 'POST',
      headers: {
        'Content-Type': 'application/json'
      },
      body: JSON.stringify(formData)
    })
    .then(response => response.json())
    .then(data => {
      console.log('Success:', data);
      // Handle success
    })
    .catch((error) => {
      console.error('Error:', error);
      // Handle error
    });
  };

  return (
    <div className="max-w-2xl mx-auto p-4">
    <h2 className="text-3xl font-bold mb-6">Add a New Plant</h2>
    <form onSubmit={handleSubmit} className="bg-white shadow-md rounded px-8 pt-6 pb-8 mb-4">
      <div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="name">Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="name" placeholder="Name" value={formData.name} onChange={handleChange} />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="scientific_name">Scientific Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="scientific_name">Scientific Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      </div><div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="scientific_name">Scientific Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      </div><div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="scientific_name">Scientific Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      </div><div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="scientific_name">Scientific Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      </div><div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="scientific_name">Scientific Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      </div><div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="scientific_name">Scientific Name</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="scientific_name" placeholder="Scientific Name" value={formData.scientific_name} onChange={handleChange} />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 text-sm font-bold mb-2" htmlFor="adopted_tech">Adopted Technology</label>
        <input className="shadow appearance-none border rounded w-full py-2 px-3 text-gray-700 leading-tight focus:outline-none focus:shadow-outline" type="text" name="adopted_tech" placeholder="Adopted Technology" value={formData.adopted_tech} onChange={handleChange} />
      </div>
      {/* Add more fields similarly */}
      <div className="flex items-center justify-between">
        <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded focus:outline-none focus:shadow-outline" type="submit">Add Plant</button>
      </div>
    </form>
  </div>
  );
}

export default AddPlant;
